export default function MessageParser({ children, actions }) {
    const parse = (message) => {
      if (message.toLowerCase().includes("add")) {
        actions.handleAdd();
      } else if (message.toLowerCase().includes("delete")) {
        actions.handleDelete();
      } else {
        actions.handleDefault();
      }
    };
    return children({ parse });
  }
